    constructor(props) {
        super(props);
        this.state = {
            clist: []
        };
    }

    componentDidMount(){
        console.log(this.props);
        this.setState({ clist: this.props });
        console.log("hello");
    }

    render() {
        
        if (this.state.clist != "") {
            
            return (
                <div className="table-wrap">
                    <table className="wrapped confluenceTable tablesorter tablesorter-default">
                        <thead>
                            <tr className="tablesorter-headerRow">
                                <th>
                                    Class Name
                        </th>
                                <th>
                                    Location
                        </th>
                                <th>
                                    Teacher Name
                        </th>
                                <th>

                                </th>
                                <th>

                                </th>

                            </tr>
                        </thead>
                        <tbody>
                           
                              
                        


                        </tbody>

                    </table>
                </div>
            )
        }
        else {
            return (
                <div>
                    <p>OOPS!! Something went wrong</p>
                </div>
            )
        }
    }





}

export default ClassesList;
